-- ******************** TABLES ********************

-- Create a relational database schema with a minimum of 3 tables

--At least 2 of the tables should contain 4 or more columns

--Two of the tables should have a many-to-many relationship

--Two of the tables should have a one-to-many relationship

--The following data types should be present somewhere in the table definitions: DATETIME, INT, VARCHAR

--Each table should be related to one or more of the other tables va a primary key/foreign key relationship

--Populate these tables with data by manually inserting data, or using some sort of import tool. INCLUDE YOUR INSERT SCRIPT. If you need help generating an insert script for a table that has a lot data in it, please let a mentor know



CREATE TABLE dbo.Patrons (
	PatronID int PRIMARY KEY,
	PatronFirstName varchar(100),
	PatronLastName varchar(100),
	PatronPhone varchar(50),
	PatronEmail varchar(100),
	PatronStreet varchar(50),
	PatronCity varchar (50),
	PatronState char (2),
	PatronZipCode varchar(10)
)

CREATE TABLE dbo.Theaters (
	TheaterID int PRIMARY KEY,
	TheaterName varchar(100),
	Capacity int
)

CREATE TABLE dbo.EventCategories (
	CategoryID int PRIMARY KEY,
	CategoryName varchar(100),
	-- Theatre, Dance, Music
)

CREATE TABLE dbo.TheatricalEvents (
	EventID int PRIMARY KEY,
	EventName varchar(200),
	EventStart datetime,
	EventEnd datetime,
	TicketPrice decimal (18, 2),
	TheaterID int FOREIGN KEY REFERENCES Theaters(TheaterID),
	CategoryID int FOREIGN KEY REFERENCES EventCategories(CategoryID)
)


CREATE TABLE dbo.Orders (
	OrderNumber int PRIMARY KEY,
	OrderDate datetime,
	PatronID int FOREIGN KEY REFERENCES Patrons(PatronID),
)

CREATE TABLE dbo.OrderItems (
	OrderNumber int FOREIGN KEY REFERENCES Orders(OrderNumber),
	EventID int FOREIGN KEY REFERENCES TheatricalEvents(EventID),
	TicketQuantity int,
	CONSTRAINT OrderItemsID PRIMARY KEY (OrderNumber, EventID)
)

