-- ******************** QUERIES********************
--Using the above tables...

--Write a SELECT query that uses a WHERE clause
SELECT *
FROM dbo.TheatricalEvents
WHERE TicketPrice < 20

--Write a  SELECT query that uses an OR and an AND operator
SELECT *
FROM dbo.Patrons
WHERE PatronState = 'KY'
OR PatronState = 'TN'
AND PatronCity <> 'Memphis'

--Write a  SELECT query that filters NULL rows using IS NOT NULL
SELECT PatronId, PatronFirstName, PatronLastName, PatronEmail
FROM dbo.Patrons
WHERE PatronEmail IS NOT NULL

--Write a  SELECT query that utilizes a JOIN
SELECT Patrons.PatronID, Patrons.PatronLastName, Orders.OrderNumber		
FROM Patrons
JOIN Orders
ON Patrons.PatronID = Orders.PatronID

--Write a  SELECT query that utilizes a JOIN with 3 or more tables
SELECT te.EventName, ec.CategoryName, t.TheaterName, t.Capacity
FROM TheatricalEvents as te
JOIN EventCategories as ec
ON te.CategoryID = ec.CategoryID
JOIN Theaters as t
ON te.TheaterID = t.TheaterID

--Write a  SELECT query that utilizes a LEFT JOIN
SELECT Patrons.PatronID, Orders.OrderNumber
FROM Patrons
LEFT JOIN Orders
ON Patrons.PatronID = Orders.PatronID

--Write a  SELECT query that utilizes a variable in the WHERE clause
 Declare @artist varchar(50) = 'Brother'

 SELECT EventName, EventStart, TicketPrice 
 FROM TheatricalEvents 
 WHERE EventName LIKE CONCAT('%',@artist,'%')

--Write a  SELECT query that utilizes a ORDER BY clause
SELECT EventName, EventStart 
FROM TheatricalEvents 
ORDER BY EventStart

--Write a  SELECT query that utilizes a GROUP BY clause along with an aggregate function (AVG, COUNT, MIN, MAX, SUM)
SELECT EventID, AVG(TicketQuantity) as 'Average Tickets per Order'
FROM OrderItems
GROUP BY EventID

--Write a SELECT query that utilizes a CALCULATED FIELD
SELECT EventID, EventName, CONVERT(DATE, EventStart) as 'Event Start Date', CONCAT('$', TicketPrice) as 'Price Per Ticket' 
FROM TheatricalEvents

--Write a SELECT query that utilizes a SUBQUERY
SELECT EventName, TicketPrice
FROM TheatricalEvents
WHERE TicketPrice = (
	SELECT MAX(TicketPrice)
	FROM TheatricalEvents
	)

--Write a SELECT query that utilizes a JOIN, at least 2 OPERATORS (AND, OR, =, IN, BETWEEN, ETC) AND A GROUP BY clause with an aggregate function
SELECT TheatricalEvents.EventName, SUM(OrderItems.TicketQuantity) as 'Number of Tickets Purchased'
FROM TheatricalEvents
JOIN OrderItems	
ON TheatricalEvents.EventID = OrderItems.EventID
WHERE TicketPrice > 50
AND EventStart > '2019-07-01'
GROUP BY TheatricalEvents.EventName

--Write a SELECT query that utilizes a JOIN with 3 or more tables, at 2 OPERATORS (AND, OR, =, IN, BETWEEN, ETC), a GROUP BY clause with an aggregate function, and a HAVING clause
SELECT p.PatronID, SUM(oi.TicketQuantity) as 'Total Tickets Purchased'
FROM Patrons as p
JOIN Orders as o
ON p.PatronID = o.PatronID
JOIN OrderItems as oi
ON oi.OrderNumber = o.OrderNumber
GROUP BY p.PatronID
HAVING SUM(oi.TicketQuantity) > 80

SELECT ec.CategoryName, 
		te.EventName, 
		SUM(oi.TicketQuantity) as 'tickets sold', 
		SUM(oi.TicketQuantity*te.TicketPrice) as 'total dollars', 
		t.Capacity-SUM(oi.TicketQuantity) as 'tickets available',
		(SUM(oi.TicketQuantity)*100/t.Capacity) as '% sold'
FROM TheatricalEvents as te
JOIN OrderItems as oi
ON te.EventID = oi.EventID
JOIN EventCategories as ec
ON ec.CategoryID = te.CategoryID
JOIN Theaters as t
ON t.TheaterID = te.TheaterID
WHERE t.TheaterName = 'Standing Theater 3'
GROUP BY te.EventName, ec.CategoryName, t.Capacity, t.TheaterName 
HAVING (SUM(oi.TicketQuantity)*100/t.Capacity) < 50

--Design a NONCLUSTERED INDEX with ONE KEY COLUMN that improves the performance of one of the above queries
	-- Improves performance of the "Write a  SELECT query that utilizes a GROUP BY clause along with an aggregate function (AVG, COUNT, MIN, MAX, SUM)" query
CREATE NONCLUSTERED INDEX IX_OrderItems_EventID
ON dbo.OrderItems (EventID)

--Design a NONCLUSTERED INDEX with TWO KEY COLUMNS that improves the performance of one of the above queries
	-- Improves performance of the "Write a  SELECT query that uses an OR and an AND operator" query
CREATE NONCLUSTERED INDEX IX_Patrons_PatronState_PatronCity 
ON dbo.Patrons (PatronState, PatronCity)

--Design a NONCLUSTERED INDEX with AT LEAST ONE KEY COLUMN and AT LEAST ONE INCLUDED COLUMN that improves the performance of one of the above queries
	-- Improves performance of the "Write a SELECT query that utilizes a SUBQUERY" query
CREATE NONCLUSTERED INDEX IX_Events_TicketPrice 
ON dbo.TheatricalEvents (TicketPrice)
INCLUDE (EventName)


--Write a DML statement that UPDATEs a set of rows with a WHERE clause. The values used in the WHERE clause should be a variable
Declare @CityName varchar(50) = 'Fort Wayne'
Declare @UpdatedCityName varchar(50) = 'Ft. Wayne'

UPDATE dbo.Patrons
SET PatronCity = @UpdatedCityName
WHERE PatronCity = @CityName

--Write a DML statement that DELETEs a set of rows with a WHERE clause. The values used in the WHERE clause should be a variable
	-- DELETE Patrons that don't have any orders

	 Declare @LocalCity varchar(50) = 'Louisville'

	 DELETE dbo.Patrons
	 FROM dbo.Patrons
	 LEFT JOIN dbo.Orders
	 ON Patrons.PatronID = Orders.PatronID
	 WHERE Orders.OrderNumber IS NULL
	 AND Patrons.PatronCity <> @LocalCity

--Write a DML statement that DELETEs rows from a table that another table references. This script will have to also DELETE any records that reference these rows. Both of the DELETE statements need to be wrapped in a single TRANSACTION.
	-- In order to delete 'Daft Punk' event from Theatrical Events, must delete the OrderItems referencing this event
BEGIN TRANSACTION
	DELETE
	FROM dbo.OrderItems
	WHERE EventID = 5028

	DELETE
	FROM dbo.TheatricalEvents
	WHERE EventID = 5028
COMMIT;


